import React from "react";

// header section

const Header = () => {
  return (
    <header>
      {/* Background Video */}
      <video
        src="path/to/video.mp4"
        autoPlay
        muted
        loop
        style={{ width: "100%", height: "auto" }}
      />

      {/* Image at the bottom right corner */}
      <img
        src="path/to/image.jpg"
        alt="Image"
        style={{ position: "absolute", bottom: 0, right: 0 }}
      />

      {/* Navigation Bar */}
      <nav style={{ display: "flex", alignItems: "center" }}>
        {/* Logo on the far left */}
        <div>
          <img src="path/to/logo.jpg" alt="Logo" />
        </div>

        {/* Navigation Links */}
        <div style={{ marginLeft: "auto" }}>
          <a href="/">Link 1</a>
          <a href="/">Link 2</a>
          <a href="/">Link 3</a>
          <a href="/">Link 4</a>
        </div>

        {/* Search Link */}
        <div>
          <a href="/">Search</a>
        </div>

        {/* Additional Navigation Links */}
        <div>
          <a href="/">Link 5</a>
          <a href="/">Link 6</a>
          <a href="/">Link 7</a>
          <a href="/">Link 8</a>
        </div>
      </nav>
    </header>
  );
};

export default Header;
